import React from 'react'
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  bar: {
    height: theme.spacing(5),
    width: "100%",
    background: "silver",
    position: "relative",
    marginTop: theme.spacing(3),
  },
  fill: {
    height: "100%",
    width: "90%",
    background: "#0e7c80",
    position: "absolute",
    top: "0",
    left: "0",
  },
  tag: {
    height: "100%",
    width: "30%",
    background: "#22686a",
    position: "absolute",
    left: "0",
    color: "white",
    letterSpacing: theme.spacing(0.2),
    '& span': {
      position: "absolute",
      top: "15%",
      left: "25%",
      textAlign: "center",
      fontWeight: "bold",
      fontSize: theme.spacing(3)

    }
  },
  percentage: {
    height: theme.spacing(5),
    width: theme.spacing(5),
    position: "absolute",
    top: "30%",
    right: "0",
  }

}))


function Skills() {
  const classes = useStyles()
  return (
      <div className={classes.bar}>
        <div className={classes.fill} >
          <div className={classes.tag}>
            <span></span></div>
        </div>
        <span className={classes.percentage}>92</span>
      </div>
  )
}

export default Skills
